INSERT INTO `products` (`id`, `name`, `des`, `images`, `price`, `created_at`, `updated_at`, `quantity`, `sort`, `category_id`, `hot`, `norms`, `video`) VALUES
(1, '春雷', '<h3>传说一</h3><p>据说鞭炮起源于爆竹。自古以来流传着这样一种说法：很久以前，每年农历</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%99%A4%E5%A4%95\">除夕</a></p><p>的晚上会出现一种叫“年”的猛兽，为了吓退这种猛兽，于是，人们在家门口燃烧竹节（或者用红色的物品贴在房外），由于竹腔内的空气受热膨胀，使得竹腔爆裂，从而发出巨响，借此驱赶</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B9%B4%E5%85%BD\">年兽</a></p><p>。随着火药的发明，火药爆竹取代了过去的竹节爆竹。</p><h3>传说二</h3><p>相传，中国古时候有一种叫\"年\"的怪兽，头长触角，凶猛异常。\"年\"长年深居海底，每到除夕才爬上岸，吞食牲畜伤害人命。因此，每到除夕这天，村村寨寨的人们扶老携幼逃往深山，以躲避\"年\"兽的伤害。这年除夕 ，</p><p><a></a><a></a><a></a><a></a><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%A1%83%E8%8A%B1%E6%9D%91\">桃花村</a></p><p>的人们正扶老携幼上山避难，从村外来了个乞讨的老人，只见他手拄拐</p><p><a href=\"https://baike.baidu.com/pic/%E7%88%86%E7%AB%B9/568048/0/a686c9177f3e67093c29b8b33bc79f3df8dc5555?fr=lemma&ct=single\" target=\"_blank\"><img src=\"http://f.hiphotos.baidu.com/baike/s%3D220/sign=83d26f93ce1b9d168ec79d63c3dfb4eb/a686c9177f3e67093c29b8b33bc79f3df8dc5555.jpg\" alt=\"爆竹传说\"></a>爆竹传说</p><p>杖，臂搭袋囊，银须飘逸，目若朗星。乡亲们有的封窗锁门，有的收拾行装，有的牵牛赶羊，到处人喊马嘶，一片匆忙恐慌景象。这时，谁还有心关照这位乞讨的老人。只有村东头一位老婆婆给了老人些食物，并劝他快上山躲避\"年\"兽，那老人捋髯笑道：\"婆婆若让我在家呆一夜，我一定把\"年\"兽撵走。老婆婆惊目细看，见他鹤发童颜、精神矍铄，气宇不凡。可她仍然继续劝说，乞讨老人笑而不语。婆婆无奈，只好撇下他，上山避难去了。半夜时分，\"年\"兽闯进村。它发现村里气氛与往年不同：村东头老婆婆家，门贴大红纸，屋内烛火通明。\"年\"兽浑身一抖，怪叫了一声。\"年\"朝婆婆家怒视片刻，随即狂叫着扑过去。将近门口时，院内突然传来\"砰砰啪啪\"的炸响声，\"年\"浑身战栗，再不敢往前凑了。原来，\"年\"最怕红色、火光和炸响。这时，婆婆的家门大开，只见院内一位身披红袍的老人在哈哈大笑。\"年\"大惊失色，狼狈逃蹿了。第二天是正月初一，避难回来的人们见村里安然无恙十分惊奇。这时，老婆婆才恍然大悟，赶忙向乡亲们述说了乞讨老人的许诺。乡亲们一齐拥向老婆婆家，只见婆婆家门上贴着红纸，院里一堆未燃尽的竹子仍在\"啪啪\"炸响，屋内几根红蜡烛还发着</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%BD%99%E5%85%89\">余光</a></p><p>……欣喜若狂的乡亲们为庆贺吉祥的来临，纷纷换新衣</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%88%B4%E6%96%B0\">戴新</a></p><p>帽，到亲友家道喜问好。这件事很快在周围村里传开了，人们都知道了驱赶\"年\"兽的办法。从此每年除夕，家家贴红对联、燃放爆竹；户户烛火通明、守更待岁。初一一大早，还要走亲串友道喜问好。这风俗越传越广，成了中国民间最最隆重的传统节日。</p><h3>传说三</h3><p><a></a><a></a><a></a><a></a><b>独脚山鬼　</b></p><p>　传说</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%BE%88%E4%B9%85%E5%BE%88%E4%B9%85%E4%BB%A5%E5%89%8D\">很久很久以前</a></p><p>，“西方山中有人焉，其长尺余，一足，性不畏人，犯之则令人寒热。以竹著火中，火扑哗有声，而上悔惮远去”。这是关于鞭炮的前身——爆竹的神话故事。所以，鞭炮有的地方又叫爆竹。</p><h3>传说四</h3><p><a></a><a></a><a></a><a></a><a href=\"https://baike.baidu.com/pic/%E7%88%86%E7%AB%B9/568048/0/2e6fa73892092981d56225b9?fr=lemma&ct=single\" target=\"_blank\"><img src=\"http://b.hiphotos.baidu.com/baike/s%3D220/sign=990bfe61720e0cf3a4f749f93a47f23d/a044ad345982b2b7d9fb6ab731adcbef76099b58.jpg\" alt=\"竹报平安\"></a>竹报平安<b>李畋先师</b></p><p>　唐朝有个皇帝叫</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%8E%E4%B8%96%E6%B0%91\">李世民</a></p><p>，李世民有个宰相叫</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%AD%8F%E5%BE%81\">魏征</a></p><p>。据说，魏征权力很大，“日管人间，夜辖阴曹”。一次，一个叫八河都总管泾河龙王的，犯了天条，被判死罪。玉帝命魏征去执行斩刑。当时正值炎热夏季的子夜，魏征昏昏入睡后，突然全身大汗淋淋，原来是他正在斩杀犯了天条的罪龙，被累出汗来的。正在这时，李世民用扇子对着魏征连扇三扇。这么一扇，风助魏征，终于帮助他斩杀了罪龙。于是，罪龙的阴魂怪罪李世民，经常兴风作案，扰的李世民坐卧不安，夜夜不得安宁。朝廷只得派大将</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%A7%A6%E5%8F%94%E5%AE%9D\">秦叔宝</a></p><p>、</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B0%89%E8%BF%9F%E6%81%AD\">尉迟恭</a></p><p>守护李世民的寝宫，才算平安无事。但是，一年365个夜晚，夜夜要守护，实在苦了秦叔宝和尉迟恭。正在为难之际，有个叫</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%8E%E7%95%8B\">李畋</a></p><p>的人想出一个办法：用小竹筒内装些硝磺，点燃爆响，山叫</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%B0%B7%E9%B8%A3\">谷鸣</a></p><p>，将鬼怪邪魅全都吓跑了。这样一来，鬼怪邪魅是吓跑了，可是爆竹发出大声，仍然使李世民不能很好安寝。后来，又有人想出办法，将大将秦叔宝和尉迟恭的画像贴在李世民的寝宫的门上，一镇鬼怪邪魅。所以，秦叔宝、尉迟恭后来就成了门神。李畋除用爆竹守护李世民的寝宫外，他还用爆竹驱岚散瘴。因为当时唐朝征战频繁，疫病盛行，贫民遭殃。李畋使用这个办法后，果然灵验。所以，后来爆竹被广泛应用于辟邪驱瘴了。后人为了纪念李畋，都尊捧他为鞭炮的</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%A5%96%E5%B8%88%E7%88%B7\">祖师爷</a></p><p>。每逢农历四月十八日李畋先师会，在祖师爷生日这天，大办宴席，铳炮齐鸣，叩头下跪，隆重庆祝一番。这种习俗，千百年来，代代相传，一宣沿袭到解放初期。2010年</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%B8%8A%E6%A0%97\">上栗</a></p><p>国际花炮节4月16-18日在花炮鼻祖李畋故乡上栗举行。主题以“科技烟花、神奇上栗” 为主题，展现了现代科技在烟花制作和燃放技术。实现烟花燃放由电脑控制，电子，遥控点火，使现代烟花，</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%84%B0%E7%81%AB\">焰火</a></p><p>燃放更加安全，表演形式也更加艳丽，丰富多彩。</p><h3>传说五</h3><p><a></a><a></a><a></a><a></a><b>孙隐崖和炼丹台</b></p><p>　中国隋末唐初，出了个著名的炼丹家和医药家</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%AD%99%E6%80%9D%E9%82%88\">孙思邈</a></p><p>。孙思邈才学超群，不但医术高明，而且炼丹技艺清湛，多次拒绝朝廷的赐封。据传，孙思邈为了专心专意炼丹和行医，先隐居在</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A4%AA%E8%A1%8C%E5%B1%B1\">太行山</a></p><p>的深山老林中，后又迢迢数千里南下避隐到</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%B9%98%E4%B8%9C\">湘东</a></p><p>山区，最后在浏阳定居下来。在浏阳县城的东门外，沿河而上，有一条小河与</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%B5%8F%E9%98%B3%E6%B2%B3\">浏阳河</a></p><p>相汇，在山岭的树林丛中，有一个岩洞，传说，孙思邈就隐居在这里。后人为了纪念这位著名的医药家和炼丹家，就把这个岩洞叫孙隐崖。孙思邈在这个崖洞中隐栖下来后，经常到浏阳县城动边30公里外盛产硫磺矿的</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%B8%83%E5%AE%9D%E5%B1%B1\">七宝山</a></p><p>采挖硫磺，把采挖回的硫磺，加上硝石和木炭等物料，装入丹炉，日夜炼制。日复一日，年复一年，孙思邈终于炼制出了火药，成为烟花、鞭炮的奠定人。人们为了铭记孙思邈对烟花、鞭炮的伟大贡献，将他炼丹的地方尊称为</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%82%BC%E4%B8%B9%E5%8F%B0\">炼丹台</a></p><p>，洗药的井和泉分别尊称为洗药井和洗药泉。时至今日，历史的巨轮已飞转了一千多个年头，但孙隐崖、炼丹台、洗药井、洗药泉仍保存完好，仿佛在悠悠地叙述着这古老的传说，真令人</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%8F%A4%E6%80%9D\">古思</a></p><p>飞扬。　传统的鞭炮制作过程分为三部分：炮身制作，火药制作和引线制作。</p><h3>传说六</h3><p><a></a><a></a><a></a><a></a><br></p><p>　　传说</p><p><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%AB%98%E9%98%B3%E6%B0%8F\">高阳氏</a></p><p>有三个儿子，死后都变成了疫鬼。两个居住在江边，一个却住在人家屋内的角落里，专门在除夕夜里出来吓唬小孩子。由于火可以驱邪，人们便在除夕夜里燃烧炉火，再加上家人团聚，疫鬼就不敢出来惊扰小孩子了。还有，一家人一面吃年夜饭，一面闲话家常，每人去谈谈自己在外面所遇到得意的事情，让家人共同分享喜悦。</p><h3>传说七</h3><p>传说很久很久以前，世上突然出现了一种怪物叫年，每当新年来临，它就要下山来吃人，所以人们新年临近时，都要搬到山脚去躲避灾难。与此同时，发生了一件奇怪的事。</p><p>有一次，年下山来了，有一个乞丐正在下山乞讨，他看见一户人家灯火通明，原来这一家人在整理东西准备向山脚奔去。</p><p>看到有人了，乞丐赶忙恳求道：“你们行行好，给我一点吃的东西吧。”</p><p>“我们都自身难保了，我劝你还是赶紧逃命去吧！”</p><p>“求求你们了，我实在太饿了。”乞丐的声音此时变得更加凄清了。</p><p>“好吧。”女主人有点心软了，她急忙从屋里拿来了一些点心，对乞丐说：“赶快逃命去吧，年兽马上就要来了。”</p><p><a></a><a></a><a></a><a></a></p><p>正在这时，年兽来了，女主人赶紧跑回屋子躲了起来。可是，凶猛的年把屋子掀了个底朝天，一步一步向女主人逼近，突然，不知从何处传出“噼里啪啦”的声音，只见乞丐正在拼命地燃放烟花、爆竹，年兽不知道这是何物，吓得赶紧逃跑。年兽怕烟花爆竹这一消息马上传开了，村民们纷纷回到自己家。于是，每当新年来临，人们都要燃放烟花爆竹，以求得新年的平安。</p><p><br></p>', 'image/timg (7).jpg', '120.00', '2018-01-05 20:41:44', '2018-01-16 22:05:17', 100, 0, 1, 0, NULL, 'file/01 春雷炮.mp4'),
(2, '闪光', '<p>斯蒂芬斯蒂芬</p>', 'image/f2e235ae8c38d5265b6b75e31784b5dd.jpeg', '100.00', '2018-01-06 21:03:49', '2018-01-06 22:01:25', 0, 0, 2, 0, NULL, NULL),
